The magic lamp can be found somewhere in the right-hand side of the ocean.  In addition, there is a guaranteed [[amulet of magical breathing]], a random [[amulet]], two random [[ring]]s, and a large amount of random treasure all lost beneath the waves.

The sea is initially populated by a large number of [[shark]]s and other hostile [[sea monster]]s, and more will spawn during normal monster creation.

