The magic lamp is contained in a chest located in one of the two hidden rooms in the "pirate ship" on the left hand side of the level, along with some gold, random gems, an [[amulet of magical breathing]], a second random [[amulet]], two [[ring]]s, and an [[oil lamp]].

Some random treasure can be found scattered throughout the level, on dry land for a change.

Notably, the level is initially populated by [[skeletal pirate]]s, and more will continue to spawn as part of random monster generation, making this one of the only places in the game where [[bullet]]s and [[flintlock]] pistols can be found.

