The magic lamp can be found somewhere in the collection of sunken buildings on the right-hand side of the ocean.  In addition, there is a guaranteed [[amulet of magical breathing]], a random [[amulet]], two random [[ring]]s, and a large amount of random treasure.

The sea is initially populated by a large number of [[crow]]s and and [[deep one]]s, and large quantities of deep and [[deepest one]]s will spawn during normal monster creation.

